css:
#todo-list-panel {
  position: relative;
  height: 100%;
  overflow: hidden;
  cursor: default;
  -webkit-user-select: none;
  min-width: 100px;
  width: 200px;
  z-index: 2;
}
#todo-list-panel .todo-list-resize-handle {
  position: absolute;
  top: 0;
  bottom: 0;
  width: 10px;
  cursor: col-resize;
  z-index: 3;
}
#todo-list-panel[data-show-on-right-side='true'] .todo-list-resize-handle {
  left: -5px;
}
#todo-list-panel[data-show-on-right-side='false'] .todo-list-resize-handle {
  right: -5px;
}
.todo-list-scroller {
  height: 100%;
  width: 100%;
  overflow: auto;
}
.todo-list {
  min-width: -webkit-min-content;
  min-height: 100%;
  padding-left: 5px;
  padding-right: 10px;
  position: relative;
}
.todo-list li {
  padding: 0px 5px 0px 5px;
}
.todo-list .complete {
  color: #2bda77 !important;
}
.todo-list .incomplete {
  color: #cc0000 !important;
}
.todo-list li:not(.head):hover {
  background-color: #0098ff;
  color: #ffffff !important;
}
.todo-list li span.msg {
  color: #ffffff;
}
.todo-list .entry:before {
  content: '';
  position: absolute;
}
hr {
  margin: 0px;
  padding: 0px;
  border: 0;
  border-top: 1px solid rgba(92, 92, 92, 0.5);
}
.platform-win32 #todo-list-panel .todo-list-resize-handle {
  cursor: ew-resize;
}
